import React from 'react';
import axios from 'axios';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import styles from './Login.module.scss';

export const Login = () => {
    const [email, setEmail] = useState('')
    const [pasw, setPasw] = useState('')
    
    const testURL = 'https://society-capital.herokuapp.com/api/login';
	const myInit = {
		method: 'POST',
		mode: 'no-cors',
        

	};

	const myRequest = new Request(testURL, myInit);

    function some () {
        fetch(myRequest).then(function(response) {
            return response;
        }).then(function(response) {
            console.log(response);
        }).catch(function(e){
            console.log(e);
        });
    }

    return (
        <div className={styles.wrapper}>
            <div className={styles.container}>
                <div className={styles.content}>
                    <div className={styles.text}>
                        Sign in
                    </div>
                    <div className={styles.form}>
                        <input autoComplete='off' placeholder='Email' value={email} onChange={event => setEmail(event.target.value)}></input>
                        <input autoComplete='off' placeholder='Password' value={pasw} onChange={event => setPasw(event.target.value)}></input>
                    </div>
                    <button onClick={() => some()}>Submit</button>
                    <hr></hr>
                    <div className={styles.signUp}>
                        Don't have an account?
                        <Link to='signup'><button>Sign up</button></Link>
                    </div>
                    <div className={styles.forgot}>
                        <Link to='/not-found'>Forgot your password?</Link>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
